DROP PROCEDURE IF EXISTS `delete_account_bind`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `delete_account_bind`(in in_wallet_addr varchar(100))
BEGIN
	#Routine body goes here...
	declare tmp_userid bigint default 0;
	declare nError integer default 0;  		-- 处理错误变量
	declare nResult integer default 0;
	declare continue handler for sqlexception set nError = -1;  		-- 如果有错误就 将值设置为 1  (CONTINUE: 继续执行，exit： 退出)

	start transaction;	#开启事务
	select userid into tmp_userid from user_info where WalletAddress = lower(in_wallet_addr);
	update user_info set WalletAddress = "" where UserID = tmp_userid;
	delete from ship where user_id = tmp_userid;
	update ts_equip_to_game set is_use = 0 where owner_address = lower(in_wallet_addr);

	if nError = -1 then	#事务处理
		rollback;
		set nResult = -1;
	else 
		commit;
	end if;
	select nResult;
END
;;
DELIMITER ;

