DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `market_equip_to_game`(in in_Id bigint, in in_nftType varchar(50), in in_itemId int, in in_sOwnerAddress varchar(50), in in_sName varchar(50), in in_sAction varchar(50), in in_sChangeDate varchar(100))
BEGIN
	#Routine body goes here...
	DECLARE nResult INT DEFAULT 0;     
	DECLARE nError INTEGER DEFAULT 0;  		-- 处理错误变量
	DECLARE nLastestId INT DEFAULT 0;

  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET nError = -1;  		-- 如果有错误就 将值设置为 1  (CONTINUE: 继续执行，exit： 退出)

