-- ----------------------------
-- Procedure structure for produce_user_equip
-- ----------------------------
DROP PROCEDURE IF EXISTS `produce_user_equip`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `produce_user_equip`(in in_sOwnerAddress varchar(50), in in_nUserId bigint)
BEGIN
	#Routine body goes here...
	declare done int default -1;
	declare tmp_id int default 0;
	declare tmp_nft_type varchar(100) default ""; 
	declare tmp_item_id varchar(100) default "";
	declare tmp_owner_address varchar(100) default "";
	declare tmp_name varchar(100) default "";
	declare tmp_action varchar(100) default "";

	declare tmp_delete_cnt int default 0;
	declare tmp_max_delete_guid bigint default 0;
	declare tmp_be_use_cnt int default 0;

	declare tmp_cnt int default 0;

	declare myCursor cursor for select id, nft_type, item_id, owner_address, name, action from 
		ts_equip_to_game where id > 0 and owner_address = in_sOwnerAddress and is_use = 0;
	declare continue handler for not found set done = 1;

	open myCursor;
	myLoop: LOOP
		/* 移动游标并赋值 */
		fetch myCursor into tmp_id, tmp_nft_type, tmp_item_id, tmp_owner_address, tmp_name, tmp_action;
		if done = 1 then
			leave myLoop;
		end if;

		if tmp_nft_type = "ship" then
			if tmp_action = "insert" then
					select count(1) into tmp_cnt from ship where user_id = in_nUserId;
			elseif tmp_action = "delete" then
					select count(1) into tmp_delete_cnt from ship where user_id = in_nUserId and ship_id = tmp_item_id;
					if tmp_delete_cnt > 1 then
						select max(ship_guid) into tmp_max_delete_guid from ship where 
							user_id = in_nUserId and ship_id = tmp_item_id and be_use = 0;
						delete from ship where ship_guid = tmp_max_delete_guid;
					else 
						delete from ship where user_id = in_nUserId and ship_id = tmp_item_id;
					end if;

					#重新设置be_use
					select count(1) into tmp_be_use_cnt from ship where user_id = in_nUserId and be_use = 1;
					if tmp_be_use_cnt = 0 then
						select count(1) into tmp_cnt from ship where user_id = in_nUserId;

						if tmp_cnt > 0 then
							update ship set be_use = 1 where ship_guid in (select b from (select min(ship_guid) b from ship where user_id = in_nUserId) as a);
						end if;
					end if;
			end if;
			update ts_equip_to_game set is_use = 1 where id = tmp_id;
		end if;
		
		set done = 0;
	end loop myLoop;
	close myCursor;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for read_data_to_game
-- ----------------------------
DROP PROCEDURE IF EXISTS `read_data_to_game`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `read_data_to_game`()
BEGIN
	#Routine body goes here...
	declare done int default -1;
	declare tmp_id int default 0;
	declare tmp_nft_type varchar(100) default ""; 
	declare tmp_item_id varchar(100) default "";
	declare tmp_owner_address varchar(100) default "";
	declare tmp_name varchar(100) default "";
	declare tmp_action varchar(100) default "";
	
	declare tmp_userid bigint default 0;

	declare tmp_delete_cnt int default 0;
	declare tmp_max_delete_guid bigint default 0;
	declare tmp_be_use_cnt int default 0;

	declare tmp_cnt int default 0;
	declare read_id int default 0;
	
	declare nError integer default 0;  		-- 处理错误变量

	declare myCursor cursor for select id, nft_type, item_id, owner_address, name, action from 
		ts_equip_to_game where id > (select cast(val as unsigned) from sys_config where attr = "read_data_to_game_idx");
	declare continue handler for not found set done = 1;

	declare continue handler for sqlexception set nError = -1;  		-- 如果有错误就 将值设置为 1  (CONTINUE: 继续执行，exit： 退出)

	start transaction;	#开启事务
		select cast(val as unsigned) into read_id from sys_config where attr = "read_data_to_game_idx" for update; 
	open myCursor;
	myLoop: LOOP
		/* 移动游标并赋值 */
		fetch myCursor into tmp_id, tmp_nft_type, tmp_item_id, tmp_owner_address, tmp_name, tmp_action;
		if done = 1 then
			leave myLoop;
		end if;

		if tmp_id <= read_id then 
			iterate myLoop;
		end if;
		
		#此语句可能为空，导致done提前被设置为1
		select userid into tmp_userid from user_info where WalletAddress = tmp_owner_address;
		if tmp_userid != 0 then
			if tmp_nft_type = "ship" then
				if tmp_action = "insert" then
						select count(1) into tmp_cnt from ship where user_id = tmp_userid;
				elseif tmp_action = "delete" then
						select count(1) into tmp_delete_cnt from ship where user_id = tmp_userid and ship_id = tmp_item_id;
						if tmp_delete_cnt > 1 then
							select max(ship_guid) into tmp_max_delete_guid from ship where 
								user_id = tmp_userid and ship_id = tmp_item_id and be_use = 0;
							delete from ship where ship_guid = tmp_max_delete_guid;
						else 
							delete from ship where user_id = tmp_userid and ship_id = tmp_item_id;
						end if;

						#重新设置be_use
						select count(1) into tmp_be_use_cnt from ship where user_id = tmp_userid and be_use = 1;
						if tmp_be_use_cnt = 0 then
							select count(1) into tmp_cnt from ship where user_id = tmp_userid;

							if tmp_cnt > 0 then
								update ship set be_use = 1 where ship_guid in (select b from (select min(ship_guid) b from ship where user_id = tmp_userid) as a);
							end if;
						end if;
				end if;
				update ts_equip_to_game set is_use = 1 where id = tmp_id;
			end if;
		end if;

		set tmp_userid = 0;
		set done = 0;
	end loop myLoop;
	close myCursor;

	if tmp_id != 0 then
		update sys_config set val = cast(tmp_id as char ) where attr = "read_data_to_game_idx";
	end if;

  if nError = -1 then	#事务处理
		rollback;
	else 
		commit;
	end if;
END
;;
DELIMITER ;

