-- ----------------------------
-- Procedure structure for take_in_or_take_out
-- ----------------------------
DROP PROCEDURE IF EXISTS `take_in_or_take_out`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `take_in_or_take_out`(in in_nUserId bigint, in action int, in in_nType int, in in_nItemId int, in in_cnt decimal)
BEGIN
	declare result int default 0;
	declare error integer default 0;  -- 处理错误变量

	declare tmp_delete_cnt int default 0;
	declare tmp_max_delete_guid bigint default 0;
	declare tmp_be_use_cnt int default 0;

	declare tmp_cnt int default 0;

	start transaction;	#开启事务 
	#飞船
	if in_nType = 4 then
			#删除
			if action = 0 then
				select count(1) into tmp_delete_cnt from ship where user_id = in_nUserId and ship_id = in_nItemId;
					if tmp_delete_cnt > 1 then
						select max(ship_guid) into tmp_max_delete_guid from ship where 
							user_id = in_nUserId and ship_id = in_nItemId and be_use = 0;
						delete from ship where ship_guid = tmp_max_delete_guid;
					else 
						delete from ship where user_id = in_nUserId and ship_id = in_nItemId;
					end if;

					#重新设置be_use
					select count(1) into tmp_be_use_cnt from ship where user_id = in_nUserId and be_use = 1;
					if tmp_be_use_cnt = 0 then
						select count(1) into tmp_cnt from ship where user_id = in_nUserId;

						if tmp_cnt > 0 then
							update ship set be_use = 1 where ship_guid in (select b from (select min(ship_guid) b from ship where user_id = in_nUserId) as a);
						end if;
					end if;
		end if;
		#添加
		if action = 1 then 
			select count(1) into tmp_cnt from ship where user_id = in_nUserId;
		end if;
	end if;

	if error = -1 then	#事务处理
		rollback;
		set result = -1 ;
	else 
		commit;
	end if;
	select result;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `insert`;
DELIMITER ;;
CREATE TRIGGER `insert` AFTER INSERT ON `user_info` FOR EACH ROW begin
  if new.WalletAddress is not null and length(new.WalletAddress) > 0 then
   call produce_user_equip(new.WalletAddress, new.UserID);
  end if;
end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update`;
DELIMITER ;;
CREATE TRIGGER `update` AFTER UPDATE ON `user_info` FOR EACH ROW begin
  if (old.WalletAddress is null || length(old.WalletAddress) = 0) and (new.WalletAddress is not null and length(new.WalletAddress) > 0) then
   call produce_user_equip(new.WalletAddress, new.UserID);
  end if;
end
;;
DELIMITER ;
